import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";

const widthRule = "(max-width: 768px)";
const notWidthRule = "(min-width: 767px)";

//Use this to pull all photos from a folder, and make an array from them
function importAll(r) {
    return r.keys().map(r);
}
const images = importAll(require.context('../assets/photos/', false, /\.(png|jpe?g)$/));
console.log(images)

const PhotoGrid = styled.div`
    display: grid;
    grid-template-columns: 1fr 1fr 1fr
    grid-template-rows: repeat();

    @media ${widthRule} {
        display: grid;
    }
`;
const PhotoCard = styled.div``;
const Photo = styled.img``;
const Header = styled.div``;

function PhotoArray(){
  var arr = [];
  fetch("http://www.x.com")
    .then(data => {console.log(data.status)})
    .catch(err => {
      console.log(err);
      arr.push(<div>No photos at the moment.</div>);
    });
  return arr;
};

var testPromise = new Promise((resolve, reject) => {
  let wait = setTimeout(() => {
    clearTimeout(wait)
    resolve("Promise Resolved")
  }, 5000)
})

export default function PhotoDisplay(props) {
  var isMobileDevice = () =>
  typeof window.orientation !== "undefined" ||
  navigator.userAgent.indexOf("IEMobile") !== -1 ||
  window.innerWidth <= 768;

  return (
    <React.Suspense fallback={<span>Content Loading</span>}>
      {`${testPromise}`}
    </React.Suspense>

  );
}
